import React from 'react';

function App(){
    return(
    
        <ul>
           <li> Addition {add(6,3)}</li>
           <li>Subtraction {sub(6,3)}</li>
           <li>Multiplication {mul(6,3)}</li>
           <li>Division {div(6,3)}</li>
        </ul>
    );
}

export default App;
